INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 7001, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, 7, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 7002, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, 7, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 7003, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, 7, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 10001, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, 10, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 10002, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, 10, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 10003, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, 10, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 10004, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 1, 10, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-416.5, 0.0, 0.0, 12001, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, 12, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 13001, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, 13, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 13002, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, 13, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 13003, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 1, 13, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 13004, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, 13, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 14001, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, 14, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 14002, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 1, 14, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 14003, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, 14, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 14004, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, 14, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-470.0, 0.0, 0.0, 15001, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, 15, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 16001, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 1, 16, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 16002, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, 16, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 16003, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, 16, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 16004, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, 16, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 17002, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, 17, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 17004, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, 25, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 17005, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, 25, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 17006, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 1, 25, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 17007, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, 25, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 18001, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, 18, "カリン", 1, 1, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 18002, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, 18, "カリン", 1, 2, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-470.0, 0.0, 0.0, 19001, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, 19, "カリン", 1, 3, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-470.0, 0.0, 0.0, 19002, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, 19, "カリン", 1, 4, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-470.0, 0.0, 0.0, 20001, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, 20, "カリン", 1, 5, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-470.0, 0.0, 0.0, 20002, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, 20, "カリン", 1, 6, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 21001, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, 21, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 21002, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, 21, "コッコロ", 1, 1, 0, 105901, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 21003, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 1, 21, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 21004, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, 21, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-430.0, 0.0, 0.0, 22001, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, 22, "カリン", 1, 1, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-430.0, 0.0, 0.0, 22002, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, 22, "カリン", 1, 2, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-430.0, 0.0, 0.0, 23001, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, 23, "カリン", 1, 3, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-430.0, 0.0, 0.0, 23002, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, 23, "カリン", 1, 4, 0, 190801, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 4.08, 8.0, 24001, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 2, 24, "エリコ（バレンタイン）", 1, 1, 10011, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 5.0, 8.0, 24002, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 2, 24, "エリコ（バレンタイン）", 1, 2, 10011, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 10.11, 8.0, 24003, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 2, 24, "エリコ（バレンタイン）", 1, 3, 10011, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 4.0, 8.0, 24004, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 2, 24, "エリコ（バレンタイン）", 1, 4, 10011, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 6.0, 8.0, 24005, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 2, 24, "エリコ（バレンタイン）", 1, 5, 10011, 109001, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24006, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, 24, "エリコ（バレンタイン）", 1, 6, 10011, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24007, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, 24, "エリコ（バレンタイン）", 1, 7, 10011, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24008, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, 24, "エリコ（バレンタイン）", 1, 8, 10011, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24009, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, 24, "エリコ（バレンタイン）", 1, 9, 10011, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24010, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, 24, "エリコ（バレンタイン）", 1, 10, 10011, 109002, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 2.12, 8.0, 24011, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 2, 24, "シズル（バレンタイン）", 1, 1, 10011, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 4.19, 8.0, 24012, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 2, 24, "シズル（バレンタイン）", 5, 2, 10011, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 2.3, 8.0, 24013, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 4, 24, "シズル（バレンタイン）", 2, 3, 10011, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24014, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, 24, "シズル（バレンタイン）", 1, 4, 10011, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 5.23, 8.0, 24015, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 2, 24, "シズル（バレンタイン）", 5, 5, 10011, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24016, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, 24, "シズル（バレンタイン）", 1, 6, 10011, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-385.0, 5.01, 8.0, 24017, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 2, 24, "シズル（バレンタイン）", 1, 7, 10011, 109101, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24018, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, 24, "シズル（バレンタイン）", 1, 8, 10011, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24019, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, 24, "シズル（バレンタイン）", 1, 9, 10011, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (0.0, 0.0, 0.0, 24020, "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, 24, "シズル（バレンタイン）", 1, 10, 10011, 109102, 0, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 26001, "2015/12/17 15:00:00", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 1, 26, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 26002, "2015/12/17 15:00:00", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 1, 26, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
