INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 27001, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", 1, 27, "シェフィ", 2, 1, 0, 106401, 2104010, "2030/12/17 14:59:59");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 27002, "2015/12/17 15:00:00", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", 1, 27, "ペコリーヌ", 1, 1, 0, 105801, 0, "2030/12/17 14:59:59");
