INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-363.0, 0.0, 0.0, 43003, "2015/12/17 15:00:00", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 1, 43, "キャル", 1, 1, 0, 106001, 0, "2030/12/17 14:59:59");
