INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (-416.5, 0.0, 0.0, 43005, "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, 44, "アメス", 1, 2, 0, 123001, 0, "2030/12/17 14:59:59");
